L["|nEnter the character name that you intend to delete its profile, the input format is \'UnitName-RealmName\'. You only need to enter name if unit is in the same realm with you.|n|nThis will delete unit gold info as well.|n|nPress key ESC to clear editbox, press key Enter to confirm."] = "|nВведите имя персонажа, чей профиль вы собираетесь удалить, формат ввода \'ИмяПерсонажа-ИмяСервера\'. Вам нужно ввести только имя, если персонаж находится на этом же сервере.|n|nЭто также приведет к удалению информации о золоте.|n|nНажмите клавишу ESC, чтобы очистить поле редактирования, нажмите клавишу Enter, чтобы подтвердить."
L["|nEnter the spell's cooldown duration.|nParty watcher only support regular spells and abilities.For spells like 'Aspect of the Wild' (BM Hunter), you need to sync cooldown with your party members."] = "|nEnter the spell's cooldown duration.|nParty watcher only support regular spells and abilities.For spells like 'Aspect of the Wild' (BM Hunter), you need to sync cooldown with your party members."
L["|nFilter messages that match the words blow. Use key SPACE between multi words."] = "|nФильтровать сообщения со словами' '. Используйте ПРОБЕЛ между несколькими словами."
L["|nFilter the loot messages of teammates based on the quality of the items."] = "|nФильтровать сообщения о добыче товарищей по команде на основе качества предметов."
L["|nIf enabled, the cooldown status would sync with players who using party watcher or ZenTracker(WA).|nThis might decrease your performance."] = "|nЕсли включено, статус восстановления будет синхронизироваться с игроками, которые используют Party Watcher или ZenTracker (WA). |nЭто может снизить вашу производительность."
L["|nLock postion and size of chat frame.|nDisable this if you want to adjust chat frame."] = "|nБлокировать положение и размер фрейма чата. |nОтключите, если вы хотите настроить фрейм чата."
L["|nOnly accept whispers from party or raid members, friends and guild members."] = "|nПринимать шепот только от участников группы или рейда, друзей и членов гильдии."
L["|nOnly show chat bubbles in raid."] = "|nОтображать пузыри чата только в рейде."
